.radioRoot input {
  border-width: 2px;
  border-color: var(--mantine-color-indigo-8);
  border-radius: 50%;

  @mixin larger-than 998px {
    border-radius: 18px;
    width: 70px;
    height: 70px;
  }
}

.radioRoot:is(:nth-child(1), :nth-child(2), :nth-child(3), :nth-child(7)) input {
  border-color: var(--mantine-color-indigo-8);
  width: 50px;
  height: 50px;

  &:checked {
    background-color: var(--mantine-color-indigo-8);
  }

  @mixin larger-than 998px {
    border-radius: 18px;
    width: 70px;
    height: 70px;
  }
}

.radioRoot:is(:nth-child(2), :nth-child(6)) input {
  width: 40px;
  height: 40px;

