    width: 28px;
    height: 28px;

    @mixin larger-than 998px {
      width: 56px;
      height: 56px;
    }
  }

  @mixin larger-than 998px {
    width: 60px;
    height: 60px;
  }
}

.radioRoot:is(:nth-child(3), :nth-child(5)) input {
  width: 30px;
  height: 30px;

  + svg {
    width: 24px;
    height: 24px;

    @mixin larger-than 998px {
      width: 50px;
      height: 50px;
    }
  }

  @mixin larger-than 998px {
    width: 50px;
    height: 50px;
  }
}

.radioRoot:nth-child(4) input {
  border-color: var(--mantine-color-dark-2);
  width: 20px;
  height: 20px;

  &:checked {
    background-color: var(--mantine-color-dark-2);
  }

  + svg {
    width: 16px;
    height: 16px;
  }

  @mixin larger-than 998px {
    width: 40px;
    height: 40px;

    + svg {
      width: 32px;
      height: 40px;
    }
  }
}

.radioRoot:is(:nth-child(5), :nth-child(6), :nth-child(7)) input {
  border-color: var(--mantine-color-lime-8);

  &:checked {
    background-color: var(--mantine-color-lime-8);
  }
}

